const CategorySelectionForm = (props) => {
  const data = {
    name: props.name,
    category: props.category,
    c_id: props.c_id,
  };
  return <option value={data}>{props.name}</option>;
};
export default CategorySelectionForm;

const voteData = [props.name, props.category, props.c_id];
